import React, { Component } from "react";
import { Route, Switch } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

/* Begin Import Components */
import ProductsList from "./products-list.component";
import ProductDetails from "./product-details.component";
import ProductCreate from "./product-create.component";
import ProductEdit from "./product-edit.component";
import ProductDelete from "./product-delete.component";
/* End Import Components */

function Product() {
    return (
        <Switch>
            {/* Begin Products Routes */}
            <Route path="/products/" exact component={ProductsList} />
            <Route path="/products/new" exact component={ProductCreate} />
            <Route path="/products/:id" exact component={ProductDetails} />
            <Route path="/products/:id/edit" exact component={ProductEdit} />
            <Route path="/products/:id/delete" exact component={ProductDelete} />
            {/* End Products Routes */}
        </Switch>
    )
  }

class ProductComponent extends Component {

  render() {
      return(
        Product()
      )
  }
}

export default ProductComponent;
